import './chatPage.css'
import { Messanger } from './components/messanger/Messanger';
import { List } from './components/list/List';

const ChatPage = () => {
    return (
        <div className='container'>
            <List/>
            <Messanger/>
        </div>
    )
}

export {ChatPage}
